import React from "react";
import Cards from './Cards';
import Sdata from "./Sdata";

function Services() {
  return (<>
    {Sdata.map((index)=>{
      return <Cards value = {index.imgsrc} value1 = {index.title}/>
    })}
  </>
  )
}
export default Services
